import Navbar from "./components/Navbar";
import Hero from "./components/Hero";
import About from './components/About';


function App() {
  return (
    <div className="bg-gray-900 text-white font-sans">
      <Navbar />
      {/* Les sections */}
      <section id="about" className="min-h-screen flex flex-col items-center justify-center text-center">
        <h2 className="text-3xl font-bold mb-4 text-purple-400">À propos</h2>
        <p className="max-w-xl">
          Je suis étudiant en informatique, passionné par le web et la data...
        </p>
      </section>
      <section id="projects" className="min-h-screen flex flex-col items-center justify-center text-center">
        <h2 className="text-3xl font-bold mb-4 text-purple-400">Projets</h2>
        <p className="max-w-xl">
          Voici quelques projets réalisés au cours de mon cursus...
        </p>
      </section>
      <section id="contact" className="min-h-screen flex flex-col items-center justify-center text-center">
        <h2 className="text-3xl font-bold mb-4 text-purple-400">Contact</h2>
        <p>marewane@example.com</p>
      </section>
      <footer className="text-center text-gray-400 p-4">
        © 2025 Marewane Fertikh — Tous droits réservés.
      </footer>
    </div>
  );
}


export default App;
